const Routes = () => (
    <BrowserRouter>
        <Switch>
            <Route exact path="/" component={Home} />
            <Route path="/motorista/login" component={Login} />
            <Route path="/motorista/cadastro" component={Cadastro}/>
            {/* <PrivateRoute path="/motorista/dashboard" component={Dashboard}/> */}
        </Switch>
    </BrowserRouter>
);

export default Routes;
